import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [page, setPage] = useState('login');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [questions, setQuestions] = useState([]);
  const [current, setCurrent] = useState(0);
  const [score, setScore] = useState(0);
  const [answered, setAnswered] = useState([]);
  const [selected, setSelected] = useState([]);
  const [timeLeft, setTimeLeft] = useState(15 * 60); // 15 minutes
  const [quizFinished, setQuizFinished] = useState(false);
  const timerRef = useRef();

  // Timer
  useEffect(() => {
    if (page !== 'quiz') return;
    timerRef.current = setInterval(() => {
      setTimeLeft((prev) => {
        if (prev <= 1) {
          clearInterval(timerRef.current);
          setQuizFinished(true);
          setPage('score');
          return 0;
        }
        return prev - 1;
      });
    }, 1000);
    return () => clearInterval(timerRef.current);
  }, [page]);

  // Fetch questions on quiz start
  const startQuiz = async () => {
    setError('');
    setScore(0);
    setCurrent(0);
    setQuizFinished(false);
    setTimeLeft(15 * 60);
    try {
      const res = await axios.get('http://localhost:5000/api/questions?limit=50');
      setQuestions(res.data);
      setAnswered(Array(res.data.length).fill(false));
      setSelected(Array(res.data.length).fill(null));
      setPage('quiz');
    } catch (err) {
      setError('Failed to load questions.');
    }
  };

  // Login
  const handleLogin = async (e) => {
    e.preventDefault();
    setError('');
    try {
      const res = await axios.post('http://localhost:5000/api/auth/login', { username, password });
      if (res.data.username) {
        setUsername(res.data.username);
        setPage('quiz');
        startQuiz();
      } else {
        setError('Login failed');
      }
    } catch (err) {
      setError(err.response?.data?.error || 'Login failed');
    }
  };

  // Register
  const handleRegister = async (e) => {
    e.preventDefault();
    setError('');
    try {
      await axios.post('http://localhost:5000/api/auth/register', { username, password });
      setError('Registration successful! Please login.');
      setTimeout(() => setPage('login'), 1200);
    } catch (err) {
      setError(err.response?.data?.error || 'Registration failed');
    }
  };

  // Quiz logic
  const handleAnswer = (option) => {
    if (answered[current]) return;
    const newAnswered = [...answered];
    newAnswered[current] = true;
    setAnswered(newAnswered);
    const newSelected = [...selected];
    newSelected[current] = option;
    setSelected(newSelected);
    if (option === questions[current].correctAnswer) {
      setScore((prev) => prev + 1);
    }
  };

  const prevQuestion = () => {
    if (current > 0) setCurrent(current - 1);
  };
  const nextQuestion = () => {
    if (current < questions.length - 1) setCurrent(current + 1);
    else {
      setQuizFinished(true);
      setPage('score');
    }
  };

  const formatTime = (t) => `${Math.floor(t / 60)}:${(t % 60).toString().padStart(2, '0')}`;

  // UI
  return (
    <div>
      {page === 'login' && (
        <div className="container" style={{ maxWidth: 400, margin: '60px auto' }}>
          <h1>Login</h1>
          {error && <div className="error">{error}</div>}
          <form className="login-form" onSubmit={handleLogin}>
            <input
              type="text"
              placeholder="Username"
              value={username}
              onChange={e => setUsername(e.target.value)}
              required
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={e => setPassword(e.target.value)}
              required
            />
            <button type="submit">Login</button>
          </form>
          <p style={{ textAlign: 'center', marginTop: 16 }}>
            Don't have an account? <button className="nav-btn" onClick={() => setPage('register')}>Register</button>
          </p>
        </div>
      )}
      {page === 'register' && (
        <div className="container" style={{ maxWidth: 400, margin: '60px auto' }}>
          <h1>Register</h1>
          {error && <div className="error">{error}</div>}
          <form className="login-form" onSubmit={handleRegister}>
            <input
              type="text"
              placeholder="Username"
              value={username}
              onChange={e => setUsername(e.target.value)}
              required
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={e => setPassword(e.target.value)}
              required
            />
            <button type="submit">Register</button>
          </form>
          <p style={{ textAlign: 'center', marginTop: 16 }}>
            Already have an account? <button className="nav-btn" onClick={() => setPage('login')}>Login</button>
          </p>
        </div>
      )}
      {page === 'quiz' && questions.length > 0 && (
        <div className="container" id="quizContainer">
          <h1>General Knowledge Quiz</h1>
          <div id="timer">Time Left: {formatTime(timeLeft)}</div>
          <div id="question" className="question">{current + 1}. {questions[current].question}</div>
          <div id="options" className="options">
            {questions[current].options.map((option, idx) => {
              let btnClass = '';
              if (answered[current]) {
                if (option === questions[current].correctAnswer) btnClass = 'correct';
                else if (option === selected[current] && option !== questions[current].correctAnswer) btnClass = 'wrong';
              }
              return (
                <button
                  key={idx}
                  onClick={() => handleAnswer(option)}
                  disabled={answered[current]}
                  className={btnClass}
                >
                  {option}
                </button>
              );
            })}
            {answered[current] && selected[current] !== questions[current].correctAnswer && (
              <p className="feedback">The correct answer was: {questions[current].correctAnswer}</p>
            )}
          </div>
          <div className="navigation">
            <button className="nav-btn" onClick={prevQuestion} disabled={current === 0}>Previous</button>
            <button className="nav-btn" onClick={nextQuestion} disabled={current === questions.length - 1}>Next</button>
          </div>
          <div id="score" className="score">Score: {score}/{questions.length}</div>
          <div className="progress-bar"><div className="progress" id="progress" style={{ width: `${((current + 1) / questions.length) * 100}%` }}></div></div>
        </div>
      )}
      {page === 'score' && (
        <div className="container" style={{ maxWidth: 500, margin: '60px auto' }}>
          <h1>Quiz Results</h1>
          <div className="score score-update" style={{ fontSize: 24, margin: '24px 0' }}>
            Your score: {score} out of {questions.length}
          </div>
          <button className="nav-btn" onClick={startQuiz}>Retake Quiz</button>
          <button className="nav-btn" onClick={() => setPage('login')} style={{ marginLeft: 12 }}>Logout</button>
        </div>
      )}
    </div>
  );
}

export default App;
